always @(posedge clk) begin: DEFLATE_FILL_BUF
    integer shift;
    reg [8-1:0] rb;
    if ((!reset)) begin
        $write("FILL RESET");
        $write("\n");
        nb <= 0;
    end
    else begin
        if ((isize < 4)) begin
            nb <= 0;
            if (1'b0) begin
                old_di <= 0;
            end
        end
        else if (((i_mode == 4) || (i_mode == 5))) begin
            nb <= 0;
            if (1'b0) begin
                old_di <= 0;
            end
        end
        else begin
            // if do_compress:
            //     print("FILL", di, old_di, nb, b1, b2, b3, b4)
            if (1'b0) begin
                shift = (($signed({1'b0, di}) - $signed({1'b0, old_di})) * 8);
                // if shift != 0:
                //     print("shift", shift, cwindow, b1, b2, b3, b4)
                if (1'b0) begin
                    cwindow <= (($signed({1'b0, cwindow}) << shift) | $signed($signed({1'b0, b110}) >>> (80 - shift)));
                end
                else begin
                    cwindow <= (($signed({1'b0, cwindow}) << shift) | $signed($signed({1'b0, b15}) >>> (40 - shift)));
                end
            end
            b1 <= iram[(di & 63)];
            if ((!1'b1)) begin
                b2 <= iram[((di + 1) & 63)];
                b3 <= iram[((di + 2) & 63)];
            end
            if ((old_di == di)) begin
                // if fcount < 9:
                //     print("fcount", fcount)
                if (1'b1) begin
                    if ((fcount >= 4)) begin
                        nb <= 1'b1;
                    end
                end
                else begin
                    nb <= 1'b1;
                end
                rb = iram[((di + fcount) & 63)];
                if (1'b1) begin
                    case (fcount)
                        'h1: begin
                            b2 <= rb;
                        end
                        'h2: begin
                            b3 <= rb;
                        end
                        'h3: begin
                            b4 <= rb;
                        end
                        'h4: begin
                            b5 <= rb;
                        end
                    endcase
                    if ((fcount < 5)) begin
                        fcount <= (fcount + 1);
                    end
                end
                else if ((fcount == 4)) begin
                    b5 <= rb;
                    fcount <= 5;
                end
                else if (1'b0) begin
                    case (fcount)
                        'h5: begin
                            b6 <= rb;
                        end
                        'h6: begin
                            b7 <= rb;
                        end
                        'h7: begin
                            b8 <= rb;
                        end
                        'h8: begin
                            b9 <= rb;
                        end
                        'h9: begin
                            b10 <= rb;
                        end
                    endcase
                    if ((fcount < 10)) begin
                        fcount <= (fcount + 1);
                    end
                end
            end
            else begin
                if (1'b1) begin
                    fcount <= 1;
                end
                else begin
                    fcount <= 4;
                    b4 <= iram[((di + 3) & 63)];
                end
            end
            old_di <= di;
        end
    end
